  <>
    <span className="dot"><img src={Dot} alt="Inactive Slide" /></span>
    <span className="dot active"><img src={TimerDot} alt="Active Slide" /></span>
    <span className="dot"><img src={Dot} alt="Inactive Slide" /></span>
    <span className="dot"><img src={Dot} alt="Inactive Slide" /></span>
  </>
);
